import React, { Component } from 'react'

export default class Navigation extends Component {
    render() {
        return (
            <nav className="navbar fixed-top navbar-dark">
                <div className="container">
                    <a className="navbar-brand" href="#google.com">Fixed top</a>
                </div>
            </nav>
        )
    }
}
